import { Navbar, Nav, Image } from 'react-bootstrap';

const Header = () => (
  <Navbar fixed="top" collapseOnSelect expand="lg" bg="light" variant="light">
    <Navbar.Brand>
      <Image src="/images/logo.png" fluid width="140px" />
    </Navbar.Brand>
  </Navbar>
)

export default Header;
